import React from 'react';

function Work(props) {

    if(props.work.isLoading){
        return(
            <div className="container">
                <div className="row">
                    LOADING....
                </div>
            </div>
        );
    }
    else if(props.work.errmess){
        return(
            <div className="container">
                <div className="row">
                    {props.errmess}
                </div>
            </div>
        );
    }
    else if(props.work.work){
        return(
            <div className="container">
                That is how we work
            </div>
        );
    }
    else {
        return(
            <div></div>
        );
    }
}

export default Work;
